  [],\n\t\"revision_timestamp\": \"2016-05-31T01:08:29.498280\",\n\t\"name\": \"northern-fur-seal-foraging-behavior-and-prey-fields-in-the-bering-sea-alaska-during-july-o-2006\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These data were used by Kuhn et al. (2015)
  to investigate how conclusions about predator-prey relationships change with increasing
  temporal disparity between predator tracking periods and prey surveys. Northern
  fur seals (n = 20) from St. Paul Island (Alaska, USA) were equipped with satellite
  tracking transmitters and time-depth recorders from July to October 2006. Fur seal
  dive and movement metrics were examined in relation to the relative abundance of
  the fur sealsu00e2u0080u0099 primary prey, walleye pollock (Gadus chalcogrammus),
  reported from the annual eastern Bering Sea groundfish survey. Relationships between
  foraging behavior metrics and prey abundance were examined within the Bering shelf
  survey grid cells at three time scales: within 2 weeks of the prey survey, within
  1 month, and over the northern fur seal reproductive season (>4 months).\",\n\t\"license_title\":
